<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta name="robots" content="noindex, nofollow">
    <title>Password Protected Page</title>
    <style>
        html, body {
            margin: 0;
            width: 100%;
            height: 100%;
            font-family: Arial, Helvetica, sans-serif;
        }
        #dialogText {
            padding: 10px 30px;
            color: white;
            background-color: #333333;
        }
        
        #dialogWrap {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: table;
            background-color: #EEEEEE;
        }
        
        #dialogWrapCell {
            display: table-cell;
            text-align: center;
            vertical-align: middle;
        }
        
        #mainDialog {
            max-width: 400px;
            margin: 5px;
            border: solid #AAAAAA 1px;
            border-radius: 10px;
            box-shadow: 3px 3px 5px 3px #AAAAAA;
            margin-left: auto;
            margin-right: auto;
            background-color: #FFFFFF;
            overflow: hidden;
            text-align: left;
        }
        #passArea {
            padding: 20px 30px;
            background-color: white;
        }
        #passArea > * {
            margin: 5px auto;
        }
        #pass {
            width: 100%;
            height: 40px;
            font-size: 30px;
        }
        
        #messageWrapper {
            float: left;
            vertical-align: middle;
            line-height: 30px;
        }
        
        .notifyText {
            display: none;
        }
        
        #invalidPass {
            color: red;
        }
        
        #success {
            color: green;
        }
        
        #submitPass {
            font-size: 20px;
            border-radius: 5px;
            background-color: #E7E7E7;
            border: solid gray 1px;
            float: right;
        }
        #contentFrame {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
        }
        #attribution {
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            text-align: center;
            padding: 10px;
            font-weight: bold;
            font-size: 0.8em;
        }
        #attribution, #attribution a {
            color: #999;
        }
    </style>
  </head>
  <body>
      <iframe id="contentFrame" frameBorder="0" allowfullscreen></iframe>
      <div id="dialogWrap">
          <div id="dialogWrapCell">
              <div id="mainDialog">
                  <div id="dialogText">La pagina è protetta da password.</div>
                  <div id="passArea">
                      <p id="passwordPrompt">Password</p>
                      <input id="pass" type="password" name="pass" autofocus>
                      <div>
                          <span id="messageWrapper">
                              <span id="invalidPass" class="notifyText">Password non valida!</span>
                              <span id="success" class="notifyText">Caricamento eseguito!</span>
                              &nbsp;
                          </span>
                          <button id="submitPass" type="button">Invia</button>
                          <div style="clear: both;"></div>
                      </div>
                  </div>
              </div>
          </div>
      </div>

          var submitPass = document.getElementById('submitPass');
          var passEl = document.getElementById('pass');
          var invalidPassEl = document.getElementById('invalidPass');
          var successEl = document.getElementById('success');
          var contentFrame = document.getElementById('contentFrame');

          if (pl === "") {
              submitPass.disabled = true;
              passEl.disabled = true;
              alert("This page is meant to be used with the encryption tool. It doesn't work standalone.");
          }

          function doSubmit(evt) {
              try {
                  var decrypted = decryptFile(CryptoJS.enc.Base64.parse(pl.data), passEl.value, CryptoJS.enc.Base64.parse(pl.salt), CryptoJS.enc.Base64.parse(pl.iv));
                  if (decrypted === "") throw "No data returned";

                  // Set default iframe link targets to _top so all links break out of the iframe
                  decrypted = decrypted.replace("<head>", "<head><base href=\".\" target=\"_top\">");

                  srcDoc.set(contentFrame, decrypted);

                  successEl.style.display = "inline";
                  passEl.disabled = true;
                  submitPass.disabled = true;
                  setTimeout(function () {
                      dialogWrap.style.display = "none";
                  }, 1000);
              } catch (e) {
                  invalidPassEl.style.display = "inline";
                  passEl.value = "";
              }
          }

          submitPass.onclick = doSubmit;
          passEl.onkeypress = function (e) {
              if (!e) e = window.event;
              var keyCode = e.keyCode || e.which;
              invalidPassEl.style.display = "none";
              if (keyCode == '13') {
                  // Enter pressed
                  doSubmit();
                  return false;
              }
          }

          function decryptFile(contents, password, salt, iv) {
              var _cp = CryptoJS.lib.CipherParams.create({
                  ciphertext: contents
              });
              var key = CryptoJS.PBKDF2(password, salt, { keySize: 256 / 32, iterations: 100 });
              var decrypted = CryptoJS.AES.decrypt(_cp, key, { iv: iv });

              return decrypted.toString(CryptoJS.enc.Utf8);
          }
